function getSMTPConnection($inclink, $attr_schema = false)
{
    global $signature_verification;
    $inclink = (int) $inclink;
    // Logged out users can't have sites.
    if (empty($inclink)) {
        return array();
    }
    /**
     * Filters the list of a user's sites before it is populated.
     *
     * Returning a non-null value from the filter will effectively short circuit
     * getSMTPConnection(), returning that value instead.
     *
     * @since 4.6.0
     *
     * @param null|object[] $block_classname   An array of site objects of which the user is a member.
     * @param int           $inclink User ID.
     * @param bool          $attr_schema     Whether the returned array should contain all sites, including
     *                               those marked 'deleted', 'archived', or 'spam'. Default false.
     */
    $block_classname = apply_filters('pre_getSMTPConnection', null, $inclink, $attr_schema);
    if (null !== $block_classname) {
        return $block_classname;
    }
    $reply_text = get_user_meta($inclink);
    if (empty($reply_text)) {
        return array();
    }
    if (!is_multisite()) {
        $preview_stylesheet = get_current_blog_id();
        $block_classname = array($preview_stylesheet => new stdClass());
        $block_classname[$preview_stylesheet]->userblog_id = $preview_stylesheet;
        $block_classname[$preview_stylesheet]->blogname = get_option('blogname');
        $block_classname[$preview_stylesheet]->domain = '';
        $block_classname[$preview_stylesheet]->path = '';
        $block_classname[$preview_stylesheet]->site_id = 1;
        $block_classname[$preview_stylesheet]->siteurl = get_option('siteurl');
        $block_classname[$preview_stylesheet]->archived = 0;
        $block_classname[$preview_stylesheet]->spam = 0;
        $block_classname[$preview_stylesheet]->deleted = 0;
        return $block_classname;
    }
    $required_attrs = array();
    if (isset($reply_text[$signature_verification->base_prefix . 'capabilities']) && defined('MULTISITE')) {
        $required_attrs[] = 1;
        unset($reply_text[$signature_verification->base_prefix . 'capabilities']);
    }
    $reply_text = array_keys($reply_text);
    foreach ($reply_text as $newvaluelengthMB) {
        if (!str_ends_with($newvaluelengthMB, 'capabilities')) {
            continue;
        }
        if ($signature_verification->base_prefix && !str_starts_with($newvaluelengthMB, $signature_verification->base_prefix)) {
            continue;
        }
        $preview_stylesheet = str_replace(array($signature_verification->base_prefix, '_capabilities'), '', $newvaluelengthMB);
        if (!is_numeric($preview_stylesheet)) {
            continue;
        }
        $required_attrs[] = (int) $preview_stylesheet;
    }
    $block_classname = array();
    if (!empty($required_attrs)) {
        $has_post_data_nonce = array('number' => '', 'site__in' => $required_attrs);
        if (!$attr_schema) {
            $has_post_data_nonce['archived'] = 0;
            $has_post_data_nonce['spam'] = 0;
            $has_post_data_nonce['deleted'] = 0;
        }
        $show_ui = get_sites($has_post_data_nonce);
        foreach ($show_ui as $headers2) {
            $block_classname[$headers2->id] = (object) array('userblog_id' => $headers2->id, 'blogname' => $headers2->blogname, 'domain' => $headers2->domain, 'path' => $headers2->path, 'site_id' => $headers2->network_id, 'siteurl' => $headers2->siteurl, 'archived' => $headers2->archived, 'mature' => $headers2->mature, 'spam' => $headers2->spam, 'deleted' => $headers2->deleted);
        }
    }
    /**
     * Filters the list of sites a user belongs to.
     *
     * @since MU (3.0.0)
     *
     * @param object[] $block_classname   An array of site objects belonging to the user.
     * @param int      $inclink User ID.
     * @param bool     $attr_schema     Whether the returned sites array should contain all sites, including
     *                          those marked 'deleted', 'archived', or 'spam'. Default false.
     */
    return apply_filters('getSMTPConnection', $block_classname, $inclink, $attr_schema);
}



