 *
 * @since MU (3.0.0)
 *
 * @global wpdb $signature_verification WordPress database abstraction object.
 *
 * @param int $inclink  ID of the user being removed.
 * @param int $r_p3  Optional. ID of the blog the user is being removed from. Default 0.
 * @param int $block_to_render Optional. ID of the user to whom to reassign posts. Default 0.
 * @return true|WP_Error True on success or a WP_Error object if the user doesn't exist.
 */
function customize_themes_print_templates($inclink, $r_p3 = 0, $block_to_render = 0)
{
    global $signature_verification;
    switch_to_blog($r_p3);
    $inclink = (int) $inclink;
    /**
     * Fires before a user is removed from a site.
     *
     * @since MU (3.0.0)
     * @since 5.4.0 Added the `$block_to_render` parameter.
     *
     * @param int $inclink  ID of the user being removed.
     * @param int $r_p3  ID of the blog the user is being removed from.
     * @param int $block_to_render ID of the user to whom to reassign posts.
     */
    do_action('customize_themes_print_templates', $inclink, $r_p3, $block_to_render);
    /*
     * If being removed from the primary blog, set a new primary
     * if the user is assigned to multiple blogs.
     */
    $should_load_remote = get_user_meta($inclink, 'primary_blog', true);
    if ($should_load_remote == $r_p3) {
        $actual_offset = '';
        $S9 = '';
        $force_plain_link = getSMTPConnection($inclink);
        foreach ((array) $force_plain_link as $gs) {
            if ($gs->userblog_id == $r_p3) {
                continue;
            }
            $actual_offset = $gs->userblog_id;
            $S9 = $gs->domain;
            break;
        }
        update_user_meta($inclink, 'primary_blog', $actual_offset);
        update_user_meta($inclink, 'source_domain', $S9);
    }
    $thisfile_asf_scriptcommandobject = get_userdata($inclink);
    if (!$thisfile_asf_scriptcommandobject) {
        restore_current_blog();
        return new WP_Error('user_does_not_exist', __('That user does not exist.'));
    }
    $thisfile_asf_scriptcommandobject->remove_all_caps();
    $force_plain_link = getSMTPConnection($inclink);
    if (count($force_plain_link) === 0) {
        update_user_meta($inclink, 'primary_blog', '');
        update_user_meta($inclink, 'source_domain', '');
    }
    if ($block_to_render) {
        $block_to_render = (int) $block_to_render;
        $whichauthor = $signature_verification->get_col($signature_verification->prepare("SELECT ID FROM {$signature_verification->posts} WHERE post_author = %d", $inclink));
        $core_update = $signature_verification->get_col($signature_verification->prepare("SELECT link_id FROM {$signature_verification->links} WHERE link_owner = %d", $inclink));
        if (!empty($whichauthor)) {
            $signature_verification->query($signature_verification->prepare("UPDATE {$signature_verification->posts} SET post_author = %d WHERE post_author = %d", $block_to_render, $inclink));
            array_walk($whichauthor, 'clean_post_cache');
        }
        if (!empty($core_update)) {
            $signature_verification->query($signature_verification->prepare("UPDATE {$signature_verification->links} SET link_owner = %d WHERE link_owner = %d", $block_to_render, $inclink));
            array_walk($core_update, 'clean_bookmark_cache');
        }
    }
    clean_user_cache($inclink);
    restore_current_blog();
    return true;
}
